class Solution {
public:
    int divisorSubstrings(int num, int k) {
        //int sum=0;
        int c=0;
        string n=to_string(num);
        for(int i=0;i<n.size()-k+1;i++)
        {
            int p=k;
            int j=i;
            string s="";
        while(p--)
        {
            s+=n[j];
            j++;

        }
            //cout<<s<<endl;
            int m=stoi(s);
            if(m!=0){
            if(num%m==0)
                c++;}
        }
        return c;
    }
};
